INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('06669d87-9d98-4c7b-9b64-18367e9f8f36', '07dda2c3-072a-4fc4-a02d-7557085edffe', 2018, 'Aquaman Collection','Arthur Curry besser bekannt unter seinem Alias "Aquaman", ist der rechtmäßige Erbe des Thrones von Atlantis. Doch bisher ist dem Sohn eines menschlichen Vaters und einer atlantischen Mutter die Herrschaft über das mystische Unterwasserkönigreich verwehrt. Aquamans Halbbruder Orm herrscht über Atlantis und möchte auch die anderen sechs Königreiche der Meere um sich scharen, um vereint einen Krieg gegen die Menschen an der Erdoberfläche zu führen. Um seinen Anspruch auf den Thron zu beweisen, macht sich Aquaman gemeinsam mit Mera auf die Suche nach dem Dreizack des ersten Königs von Atlantis. Als Orm von diesem Plan erfährt, hetzt er den beiden den Piraten Black Manta auf den Hals, welcher mit Aquaman selbst noch eine Rechnung zu begleichen hat.', 12, 143, '/img/movies/aquaman.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('feace4d4-d3e5-4334-9870-5bf209fc881f', '07dda2c3-072a-4fc4-a02d-7557085edffe', 2018, 'Bumblebee','Im Jahr 1987 versteckt sich das mysteriöse Maschinenwesen Bumblebee in der Gestalt eines alten VW Käfers auf dem Schrottplatz einer kleinen kalifornischen Küstenstadt. Kurz vor ihrem 18ten Geburtstag und auf der Suche nach ihrem Platz im Leben, findet die rebellische Charlie (Hailee Steinfeld) den kaputten und kampfgeschwächten Bumblebee. Mit mechanischem Geschick beginnt sie ihn zu reparieren und lernt schnell, dass es sich keineswegs nur um eine alte Schrottmühle handelt …', 12, 114, '/img/movies/Bumblebee.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('e6e0f02a-dcad-4316-bad0-7099035f2c6e', '07dda2c3-072a-4fc4-a02d-7557085edfwf', 2018, 'Bird Box','Ein mysteriöser Schrecken hat die Welt heimgesucht. Es handelt sich dabei um eine mysteriöse Macht, die seine Opfer in den Selbstmord treibt. Sobald man sie erblickt erlebt man seine schlimmsten Ängste. Um sich und ihre zwei Kinder vor diesem grausamen Schicksal zu bewahren, muss sich Malorie mit ihnen in dieser in Angst und Schrecken versetzten Welt durchkämpfen. Dies mit verbundenen Augen, um dem unheimlichen Wesen keine Angriffsfläche zu bieten. Malorie erfährt von einem Ort am Fluß, an dem ein Überleben, vielleicht möglich ist. In einem kleinem Boot wagt sie mit ihren Kindern die gefährliche Fahrt...', 16, 117, '/img/movies/birdbox.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('93afc908-09e4-47ba-803c-b2eb2b86a7ae', '07dda2c3-072a-4fc4-a02d-7557085edffd', 2018, 'Mary Poppins Returns','Mary Pooins kehrt in das Haus der Familie Banks zurück, um der nächsten Banks-Generation nach einem tragischen Verlust wieder Freude und Heiterkeit zu bringen.', 12, 128, '/img/movies/marypoppins.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('9d496b2f-91d1-4498-86aa-27ef6824423e', '07dda2c3-072a-4fc4-a02d-7557085edehw', 2018, 'Venom','Als Dr. Carlton, Chef der mysteriösen Life Foundation, in den Besitz eines Organismus außerirdischen Ursprungs kommt, benutzt er diese sogenannten Symbionten, um mit ihnen Experimente an Menschen durchzuführen. Dank des Tipps einer Konzern-Insiderin bekommt der Reporter Eddie Brock Wind von Drakes fragwürdigen Machenschaften und beschließt – entgegen der Warnung seiner Freundin Anne– der Sache auf den Grund zu gehen. Bei seinen Nachforschungen in den Labors der Life Foundation kommt Eddie jedoch selbst mit einem Symbionten in Kontakt, der mit ihm zu einem neuen Wesen verschmilzt: dem mit übermenschlichen Kräften ausgestatteten Venom.', 12, 112, '/img/movies/venom.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('3f090002-688e-4969-bda6-d906f8defbbf', '07dda2c3-072a-4fc4-a02d-7557085eofhe', 2018, 'Phantastische Tierwesen: Grindelwalds Verbrechen','Gellert Grindelwald für dessen Verhaftung Newt Scamander gesorgt hatte, ist die Flucht gelungen. Und nicht nur das: Der Schurke hat zwischenzeitlich eine noch größere Anhängerschaft aus Zauberern um sich geschart, um seinen düsteren Plan umzusetzen, der die Vorherrschaft der reinblütigen Magier vorsieht. Einzig Grindelwalds ehemals bester Freund Albus Dumbledore wäre in der Lage, ihn zu stoppen, aber dazu wiederum benötigt dieser die Hilfe seines früheren Schülers Scamander, der so in sein nächstes Abenteuer stürzt – und dieses Mal verschlägt es ihn nach Europa, genauer gesagt nach Paris.', 12, 134, '/img/movies/grindelwalds_verbrechen.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('9681fb89-70f7-43a3-9d79-deccb54aa9d9', '07dda2c3-072a-4fc4-a02d-7557081ffede', 2018, 'Spider-Man: A New Universe','Animations-Abenteuer um Superheld Spider-Man. Im Gegensatz zu den Realfilmen geht es aber nicht um Peter Parker, sondern um Miles Morales – und noch andere Spinnenmänner..', 6, 117, '/img/movies/spiderman_into_the_spider_verse.jpg');
INSERT INTO MOVIE (movie_uuid, genre_uuid, prod_year, movie_title, movie_description, fsk, runtime, picture) VALUES ('9b7bb5bd-6757-4b55-9af5-6d3ff1580042', '07dda2c3-072a-4fc4-a02d-7557085eofhe', 2018, 'Robin Hood','Der junge Robin von Locksley (Taron Egerton) kehrt vom Schlachtfeld der Kreuzzüge zurück. In England erwarten ihn Korruption, Intrigen und die grausame Herrschaft des Sheriffs von Nottingham (Ben Mendelsohn), der das Volk bis zur bitteren Armut ausbeutet. Robin Hood beschließt gemeinsam mit seinem Verbündeten Little John (Jamie Foxx), die Missstände nicht länger hinzunehmen und gegen die vorherrschende Ungerechtigkeit zu kämpfen. Sie legen sich mit den höchsten Instanzen an und haben schon bald den skrupellosen Sheriff von Nottingham zum Feind.', 12, 116, '/img/movies/robin-hood.jpg');
